import React from 'react';
import Footer from '../components/Footer';
import '../styles/form.css';

function Form() {
  return (
    <div>
      <form>
        <fieldset>
          <legend>Junte-se ao time</legend>
          <p>
            <input
              type="text"
              name="name"
              id="client-name"
              placeholder="Nome Completo"
            />
          </p>
        </fieldset>
      </form>
      <footer>
        <Footer />
      </footer>
    </div>
  );
}

export default Form;
